tables.table_schema:
CREATE TABLE TradeAgreements (
    agreement_id INT PRIMARY KEY,
    player_id INT,
    team_id INT,
    trade_date DATE
);

CREATE TABLE SalaryCapManagement (
    team_id INT PRIMARY KEY,
    current_salary_cap DECIMAL,
    remaining_cap DECIMAL
);

CREATE TABLE player_contracts (
  player_id INT PRIMARY KEY,
  contract_amount DECIMAL,
  contract_duration INT,
  signing_date DATE
);

CREATE TABLE trade_agreements (
  trade_id INT PRIMARY KEY,
  receiving_team_id INT,
  sending_team_id INT,
  trade_date DATE
);

CREATE TABLE salary_cap_management (
  team_id INT PRIMARY KEY,
  current_cap DECIMAL,
  cap_space DECIMAL
);

CREATE TABLE player_stats (
  player_id INT PRIMARY KEY,
  games_played INT,
  batting_average DECIMAL,
  home_runs INT
);
